<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Daphne in Canada — Coming Soon</title>
  <link href="https://fonts.googleapis.com/css2?family=Great+Vibes&family=Poppins:wght@300;400;600;700&display=swap" rel="stylesheet">
  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.2/css/all.min.css" crossorigin="anonymous" referrerpolicy="no-referrer" />
  <style>
    :root {
      --bg: #fff0f5;
      --accent: #ff69b4;
      --accent-light: #ffd6f0;
      --text: #333;
      --panel-bg: #ffffffdd;
    }
    * { box-sizing: border-box; margin:0; padding:0; }
    body {
      font-family: 'Poppins', 'Great Vibes', sans-serif;
      background: linear-gradient(135deg, #ffe6f0, #fff0f5);
      color: var(--text);
      display: flex;
      align-items: center;
      justify-content: center;
      min-height: 100vh;
      padding: 20px;
    }
    .container {
      max-width: 700px;
      text-align: center;
      background: var(--panel-bg);
      border-radius: 30px;
      padding: 50px 30px;
      box-shadow: 0 10px 30px rgba(0,0,0,0.1);
      backdrop-filter: blur(6px);
    }
    .logo {
      width: 90px;
      height: 90px;
      background: linear-gradient(135deg, var(--accent), var(--accent-light));
      border-radius: 50%;
      display: inline-flex;
      align-items: center;
      justify-content: center;
      font-size: 36px;
      font-weight: 700;
      color: #fff;
      margin-bottom: 25px;
      box-shadow: 0 4px 15px rgba(255,105,180,0.3);
    }
    h1 {
      font-size: 38px;
      margin-bottom: 15px;
      color: var(--accent);
      font-family: 'Great Vibes', cursive;
    }
    p {
      font-size: 16px;
      margin-bottom: 20px;
      color: #555;
      line-height: 1.5;
    }
    .details {
      font-family: 'Poppins', sans-serif;
      font-size: 15px;
      color: #555;
      margin-bottom: 25px;
      line-height: 1.6;
    }
    .socials { display: flex; justify-content: center; gap: 25px; margin-top: 30px; }
    .socials a svg { width: 32px; height: 32px; transition: transform 0.2s; fill: var(--accent); }
    .socials a:hover svg { transform: scale(1.2); }
  </style>
</head>
